const Favorites = () => {
  const { _id } = useSelector((state) => state.auth.data);
  const [cards, setCards] = useState();

  useEffect(() => {
    axios.get(`/favorites:${_id}`).then((res) => {
      setCards(res.data);
    });
  }, []);

  return <div className="favorites-contaner"></div>;
};

export default Favorites;
